import React from "react";
import "./chatpage.css";

const ChatPage = ({ dark }) => {
  // console.log(dark)

  //color scheme set
  const backgroundColor = dark ? "#121212" : "#F2EEEE";
  const primary = dark ? "white" : "black";
  return (
    <div
      className="chatpage-wrapper"
      style={{ backgroundColor: backgroundColor }}
    >
      <div className="user-wrapper">
        <div>
          <h2 className="user-title">Messages</h2>
        </div>
      </div>
      <div className="chat-wrapper">
      <div>
          <h2 className="chat-title">Select a user to start a conversation</h2>
        </div>
      </div>
    </div>
  );
};

export default ChatPage;
